          "title": "Ferrari 296 GTB | La PROVA su strada di Masterpilot",
          "description": "Larrivo della nuova Ferrari 296 GTB segna un vero e proprio punto di svolta nella produzione automobilistica firmata dalla Casa di Maranello. S perch se  vero che la Purosangue sar qualcosa di inedito e alieno nella gamma rossa,  altrettanto vero che un motore V6per giunta turbocompresso ha tutte le carte in regola per risultare ancora pi indigesto ai puristi che non hanno ancora finito di chiacchierare sullarrivo della SUV a quattro porte (le posteriori a favore di vento). \nDel resto quando si pensa a Ferrari si sognano prima di tutto i motori e se per la Sport Utility Vehicle  stato almeno mantenuto il V12 aspirato, fattore che la render unica e speciale nel panorama automobilistico mondiale, nella nuova Berlinetta si parla di un motore che sino ad oggi si era visto solo nella Dino (una NON Ferrari) e nei propulsori da competizione. Anzi, proprio il motore turbo della F1 di Arnoux aveva una configurazione molto simile a quella di questo nuova unit visto che langolo compreso tra le bancate  di 120. Non parliamo mica di un motorino, dunque, ma di un pezzo di meccanica che una radice nella storia del Cavallino ce lha anche se in ambientazioni completamente diverse rispetto a quelle della strada, dove da sempre dominano i V12 ed i V8.\n\nI tempi per cambiano e partendo dallesperienza maturata con il pluripremiato 3.9 V8 (v90) F154, declinato in diversi livelli di potenza e installato anteriormente e centralmente in diversi prodotti della gamma, i tecnici Ferrari sono riusciti nellimpresa di dare vita al nuovo 2.992 cc della famiglia F163, che al suo primo stadio evolutivo eroga la bellezza di 663 CV (221 cv/litro) frutto di un alesaggio di 88 mm ed una corsa di 82 e del lavoro di due turbocompressori IHI con giranti montate su cuscinetti che lavorano in fase controrotante tra le bancate. Un motore compattissimo, estremamente leggero, in cui liniezione  curata attraverso luso di iniettori che lavorano a 350 bar con candele poste al centro delle camere di combustione.\n\nUn motore iper tecnologico in cui nulla  lasciato al caso, nemmeno le strategie di ibridazione che sono parte dello sviluppo di questo motore: si perch tra gli elementi che fanno storcere il naso ai famosi puristi c anche una sofisticata parte ibrida che scende direttamente dallesperienza accumulata con la SF90 Stradale: ecco perch Ferrari dichiara per questa 296 GTB la bellezza di 830 CVperch lelettrico contribuisce alla spinta con 167 CV e 315 Nm di coppia massima che prendono energia da un pacco batterie agli ioni di litio posto dietro ai sedili (7,4 kWh) in grado di assicurare 25 km di autonomia in elettrico. Un motore che  in grado di spingere la vettura anche indipendentemente dal lavoro del V6 e che  pensato per contribuire alla spinta oltre che per recuperare energia in fase di frenata e di controllo di trazione. S, avete capito bene: controllo di trazione. Perch questa Ferrari, come la SF90 Stradale, gestisce questa fondamentale fase prestazionale con la frenatura del motore elettrico (recupera addirittura energia)decisamente pi efficace rispetto ai comunque presenti tagli sulla iniezione e sui freni. Pi corta di passo rispetto alla F8/488 - 2.600 mm - la nuova 296 GTB  lunga 456 cm e pesa 1.470 kg: un peso piuma vista la cavalleria disponibile che per forza di cose richiede rigidit torsionali elevatissime alla scocca in alluminio ma anche un grande lavoro da parte di freni (Brembo carboceramici con pinza monoblocco anteriore a sei pistoncini) ruote, gomme, sospensioni e di tutto quello che contribuisce alla performance e che solamente qualche anno fa sarebbe passato in secondo piano. Laerodinamica, per esempio,  curatissima ed oltre ad assicurare un drag molto ridotto la vettura  in grado di generare 350 kg di carico a 250 km/h senza eccedere in elementi alari che avrebbero sporcato il grande lavoro di stile compiuto da Flavio Manzoni: una piccola grande opera darte con una finitura degli elementi quasi scultorea che  tipica de